import React,{useState,useEffect} from"react"
import axios from "axios";
import { AuthService } from "./AuthService ";

export default function HomePage(){
    const[count,getCount]=useState();

    const getcount =()=>{
        
        axios.get('http://localhost:6060/Vehicle/')
      .then((res) => {
        console.log(res.data.length);
        getCount(res.data.length);
      })
      .catch((err) => {
        alert(err.message);
      });    

    }

    useEffect(()=>{
        getcount();
    },[]);

    const handleLogout = () => {
      AuthService.logout(); // Call the logout method from AuthService
      window.location.href = '/'; // Redirect to the login page after logout
    };
  // Correct usage of AuthService
    const isLoggedIn = AuthService.isLoggedIn();
  
    
  
    useEffect(() => {
      if (!isLoggedIn) {
        // Redirect to login if user is not logged in
        window.location.href = '/';
      }
    }, [isLoggedIn]);

    const backgroundImageUrl = 'http://localhost:6060/images/jeba.png';

    const divStyle = {
    backgroundImage: `url(${backgroundImageUrl})`,
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundAttachment: 'fixed',
    // Add other background-related styles as needed
};

    return(

      <div >
             <div class="container-login100"style={{ ...divStyle, width: "100%", height: "100vh" }}> 
          <div class="sidebar">
            <div class="admin-info">
              <img src="http://localhost:6060/images/man.jpg" alt="Admin Logo"/>
              <p >Sathsara</p>
              <hr/>
            </div>
            <ul>
              <li><a href="/Header/:id">Home</a></li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Vehicles</a>
                <div class="dropdown-content">
                  <a href="/all">All Vehicles</a>
                  <a href="/add">Add Vehicle</a>
                  
                </div>
              </li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Users</a>
                <div class="dropdown-content">
                  <a href="/AllUser">All Users</a>
                  <a href="/AddUser">Add User</a>
                
                </div>
              </li>
              <li class="dropdown">
                <a href="#" class="dropdown-toggle">Booking</a>
                <div class="dropdown-content">
                  <a href="/pBook">Pending Bookings</a>
                  <a href="/Abook">Accept bookings</a>
                </div>
              </li>
              <li><a href="/inde">Settings</a></li>
              <li><button onClick={handleLogout}>Logout</button></li>
            </ul>
          </div>

          <div class="content1">
            
          </div>
       
        <div>
       
        <div style={{marginLeft:"35%" ,display: "flex" ,height: "100vh",marginTop:"50px" }}>
          <div style={{ width: "100px", height: "100px", backgroundColor: "#3498db", color: "#fff", padding: "10px", marginBottom: "10px", marginLeft:"40px" }}>
                Total Vehicles:<br/> <span style={{ fontWeight: "bold" }}>{count}</span>
            </div>

            <div style={{ width: "100px", height: "100px", backgroundColor: "#2ecc71", color: "#fff", padding: "10px", marginBottom: "10px" , marginLeft:"40px" }}>
                Total Users: <span style={{ fontWeight: "bold" }}>[Value]</span>
            </div>

            <div style={{ width: "100px", height: "100px", backgroundColor: "#e74c3c", color: "#fff", padding: "10px", marginBottom: "10px", marginLeft:"40px"  }}>
                Total Income: <span style={{ fontWeight: "bold" }}>[Value]</span>
            </div>

            <div style={{ width: "100px", height: "100px", backgroundColor: "#f39c12", color: "#fff", padding: "10px", marginBottom: "10px", marginLeft:"40px"  }}>
                Another Metric: <span style={{ fontWeight: "bold" }}>[Value]</span>
            </div>
         </div>   
    </div>
</div>
</div>  
    )
}
